		setId(e.target.value);
	};
	handleChangePassword = e => {
		setId(e.target.value);
	};

	return (
		<form>
			<div>
				<label htmlFor="user-id"> id </label>
				<input name="user-id" type="text" onChange={handleChangeId}></input>
			</div>
			<div>
				<label htmlFor="user-password"></label>
				<input
					name="user-password"
					type="password"
					onChange={handleChangePassword}
